use std::sync::Arc;

use criterion::{black_box, criterion_group, criterion_main, Criterion};
use lru::LruCache;
use nom_sql::parse_select_statement;
use readyset_client::query::Query;
use readyset_client::ViewCreateRequest;
use xxhash_rust::xxh3;

fn hash_benchmarks(c: &mut Criterion) {
    let mut group = c.benchmark_group("xxHash Benchmarks");

    let queries = QUERY_CORPUS
        .iter()
        .map(|q| {
            Query::Parsed(Arc::new(ViewCreateRequest {
                statement: parse_select_statement(readyset_sql::Dialect::MySQL, q).unwrap(),
                schema_search_path: vec!["public".into()],
            }))
        })
        .collect::<Vec<Query>>();

    let mut i = 0;
    let len = queries.len();

    group.bench_function("xxHash 64-bit", |b| {
        let mut lru_cache = black_box(LruCache::<u64, bool>::new(100.try_into().expect("nonzero")));

        b.iter(|| {
            let hash = xxh3::xxh3_64(bincode::serialize(&queries[i % len]).unwrap().as_slice());
            if !lru_cache.contains(&hash) {
                lru_cache.put(hash, true);
            }
            i += 1;
        });
    });

    group.bench_function("xxHash 128-bit", |b| {
        let mut lru_cache = black_box(LruCache::<u128, bool>::new(
            100.try_into().expect("nonzero"),
        ));

        b.iter(|| {
            let hash = xxh3::xxh3_128(bincode::serialize(&queries[i % len]).unwrap().as_slice());
            if !lru_cache.contains(&hash) {
                lru_cache.put(hash, true);
            }
            i += 1;
        });
    });

    group.finish();
}

criterion_group!(benches, hash_benchmarks);
criterion_main!(benches);

